function redirection_scheduler_form_listener(){document.querySelector("#redirection-scheduler-set-form")&&document.querySelector("#redirection-scheduler-set-form").addEventListener("submit",e=>{e.preventDefault();var t=new FormData(e.target);fetch(e.target.action,{method:"POST",body:t}).then(e=>e.json()).then(e=>{e.success?(alert("Redirect successfully scheduled."),window.location.reload()):alert(e.data[0].message)}).catch(e=>{console.log(e)})})}window.addEventListener("DOMContentLoaded",redirection_scheduler_form_listener);